import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css'; // Mengimpor file CSS utama (diperlukan untuk Tailwind)
import App from './App'; // Mengimpor komponen utama aplikasi Anda

// Memilih elemen root dari public/index.html
const rootElement = document.getElementById('root');

if (rootElement) {
  // Menggunakan React 18+ API untuk rendering
  const root = ReactDOM.createRoot(rootElement);

  root.render(
    <React.StrictMode>
      {/* Komponen App adalah seluruh antarmuka aplikasi POS Anda */}
      <App />
    </React.StrictMode>
  );
} else {
    // Pesan peringatan jika elemen root tidak ditemukan (seharusnya tidak terjadi jika index.html benar)
    console.error("Gagal menemukan elemen root di HTML. Pastikan <div id=\"root\"> ada.");
}
